import { useState, useEffect } from "react";
import axios from "axios";
import "./applicantreport.css";

function ApplicantReportPage() {
  const [applicantList, setApplicantList] = useState([]);
  const [selectedApplicantId, setSelectedApplicantId] = useState("");
  const [applicantData, setApplicantData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Fetch applicant data from backend
  useEffect(() => {
    const fetchApplicantData = async () => {
      try {
        const response = await axios.get("http://localhost:5000/api/applicants");
        setApplicantList(response.data);
        setLoading(false);
      } catch (err) {
        setError("Failed to fetch applicant data");
        setLoading(false);
        console.error("Error fetching applicant data:", err);
      }
    };

    fetchApplicantData();
  }, []);

  const handleApplicantSelect = (e) => {
    const selectedId = e.target.value;
    setSelectedApplicantId(selectedId);
    
    if (selectedId === "") {
      setApplicantData(null);
      return;
    }
    
    const selectedApplicant = applicantList.find(
      (applicant) => applicant.applicant_id.toString() === selectedId
    );
    setApplicantData(selectedApplicant || null);
  };

  if (loading) {
    return <div className="applicant-report-container">Loading applicant data...</div>;
  }

  if (error) {
    return <div className="applicant-report-container">{error}</div>;
  }

  return (
    <div className="applicant-report-container">
      <h2>Applicant Report</h2>

      <div className="applicant-select-container">
        <label htmlFor="applicant-select">Select Applicant:</label>
        <select
          id="applicant-select"
          value={selectedApplicantId}
          onChange={handleApplicantSelect}
          disabled={applicantList.length === 0}
        >
          <option value="">-- Choose an Applicant --</option>
          {applicantList.map((applicant) => (
            <option key={applicant.applicant_id} value={applicant.applicant_id}>
              {applicant.applicant_name} (ID: {applicant.applicant_id})
            </option>
          ))}
        </select>
      </div>

      {applicantData ? (
        <div className="applicant-details">
          <h3>Applicant Report - {applicantData.applicant_name}</h3>
          <div className="detail-row">
            <span className="detail-label">ID:</span>
            <span className="detail-value">{applicantData.applicant_id}</span>
          </div>
          <div className="detail-row">
            <span className="detail-label">Email:</span>
            <span className="detail-value">{applicantData.applicant_email}</span>
          </div>
          <div className="detail-row">
            <span className="detail-label">Age:</span>
            <span className="detail-value">{applicantData.applicant_age}</span>
          </div>
          <div className="detail-row">
            <span className="detail-label">Gender:</span>
            <span className="detail-value">{applicantData.applicant_gender}</span>
          </div>
          <div className="detail-row">
            <span className="detail-label">Qualification:</span>
            <span className="detail-value">
              {applicantData.qualification_name || `ID: ${applicantData.quali_id}`}
            </span>
          </div>
          <div className="detail-row">
            <span className="detail-label">Experience:</span>
            <span className="detail-value">{applicantData.applicant_experience} years</span>
          </div>
          <div className="detail-row">
            <span className="detail-label">Status:</span>
            <span className="detail-value">{applicantData.status || 'N/A'}</span>
          </div>
        </div>
      ) : (
        <p className="select-prompt">Please select an applicant from the dropdown to view details.</p>
      )}
    </div>
  );
}

export default ApplicantReportPage;
